import '../../data/models/pricing_details_dto.dart';class PricingDetails {  PricingDetails({    this.id,    this.seasonseId,    this.seasonseName,    this.projectId,    this.shiftId,    this.shiftName,    this.fromDay,    this.toDay,    this.salary,    this.setAsDefault,    this.isAllowEditPrice,    this.jobId,    this.jobName,  });  int? id;  int? seasonseId;  String? seasonseName;  int? projectId;  int? shiftId;  String? shiftName;  int? fromDay;  int? toDay;  double? salary;  bool? setAsDefault;  bool? isAllowEditPrice;  int? jobId;  String? jobName;  factory PricingDetails.fromDto(PricingDetailsDto json) {    return PricingDetails(      seasonseName: json.seasonseName,      id: json.id,      shiftName: json.shiftName,      seasonseId: json.seasonseId,      fromDay: json.fromDay,      projectId: json.projectId,      toDay: json.toDay,      shiftId: json.shiftId,      salary: json.salary,      setAsDefault: json.setAsDefault,      isAllowEditPrice: json.isAllowEditPrice,      jobName: json.jobName,      jobId: json.jobId,    );  }}